import "./Error.css";
import { NavLink } from 'react-router-dom';
import ErrorPic from '../assets/ErrorPic.png';
import Button from '@mui/material/Button';

// var sectionStyle ={
//     width: "100%",
//     height: "400px",
//     backgroundImage: "url(" + { ErrorPic } + ")"
// };

const Error = () => {
    return (<div style = {{display:'flex', justifyContent:'center', alignItems:'center'}}>
                <div>
                    <>
                        <img src={ErrorPic} alt="error"  width='100%' height = '500px'/>
                    </>
                    <div style={{display:'flex'}} ><Button color ='primary' component = {NavLink} to = '/' variant ="contained" style = {{textTransform:'none', marginTop:'20rem', textDecoration:'none'}} disableRipple>Go Home</Button></div>
                </div>
            </div>);
}
export default Error;
